import React from 'react'
import {Field, reduxForm} from 'redux-form'
import TextField from '@material-ui/core/TextField';

class StreamCreate extends React.Component{
    render(){
    return(
        <div>
            <form>
                    <TextField 
                    id="outlined-basic" 
                    label="Outlined" 
                    variant="outlined"
                    className="outlined"
                    />
            </form>
        </div>
    )
    }
}

export default reduxForm({
    form: 'streamCreate'
})(StreamCreate)
